import React from "react";
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import App from './App';
import Signup from "./auth/Signup";

const Paths = () => {
    return(
        <BrowserRouter>
        <Routes>
            <Route path='/' Component={App} />
            <Route exact path='/signup' Component={Signup} />
        </Routes>
        </BrowserRouter>
    )
}


export default Paths;
